@Plants_and_Tea D:

That does not make her feel ANY better about eating her greens

“SEE I KNEW SPINACH WAS TRYING TO K!LL ME!!”

@JuiceLikeWater “Okay I’ll just take something else then!”

“… can I have that shield?”

The shield that is like twice her size-

@ToothedPaste Alright!

*Hands over like a bunch of gold coins she probably stole from cream cookie*

Is that enough?

@Plants_and_Tea Stares

“… I mean that looked cool but it’s not what I wanted to blow up!”

&gt;:T

@PicnicBlossoms 

*tug tug. Stares 👁👁*

Sister I require nutrients.

@SquirrelGremlin “…”

Hands him a bomb.

“Here. You can catch up.”

@fizzy_trickster “You were something else before Devil cookie?”

She always just assumed they were Devil, like how she’s always been cherry and Gumball has always been gumball.

“Well we don’t have to talk about that, but instead focus on the harp thingy! How do you play it?”

@UNDERWRLDRULER “…”

You know what, Sakura raised no pu$$y 😤 after one deep breath she tilt her head back and chugged it like a champ … and started gagging and coughing.

“Gods- that tasted awful- really bitter”

@UNDERWRLDRULER “… look over there!”

She points in one direction before throwing the cup in the other direction, not even giving him a chance to look away

“Oh no I dropped it. Sigh, oh well. The ground can enjoy it.”

@UNDERWRLDRULER “…”

Huh, usually the adults try to talk sense into her. Or she says that shit for attention. So now she’s kinda just standing there and looking at the cup.

“Oh yeah! I’m gonna drink it. Uh- what flavor is it-?”

@CinnyMagician “Okay!”

…

“I don’t have a phone, I’m too young-“
